import './App.css';
import React from 'react';
import './App.css';
import {BrowserRouter, Routes, Route } from 'react-router-dom';
import Provider from './context/Provider';
import Home from './pages/Home';

function App() {
  return (
    <div className="App">
    <Provider>
      <BrowserRouter>
      <Routes>
        <Route path="/" element={ <Home/> }  />
      </Routes>
      </BrowserRouter>
    </Provider>
    </div>
  );
}

export default App;
